description:
Alien Hunters

Science Documentary hosted by Bill Courage, published by Discovery Channel broadcasted as part of DC Legend Hunters series in 2006 - English narration


Information
------------------------------

Every year, thousands of people all over the world report seeing an unidentified flying object, or UFO. There are also numerous and eerily similar stories of people being abducted by alien creatures, reports of unexplained crop circles and cattle mutilations. This overwhelming body of evidence leads our investigators to ask, &quot;If it's not aliens, what is it?&quot; In this episode of Legend Hunters, we follow world leading researchers in their quest to once and for all solve one of the greatest mysteries of the modern world and perhaps prove that we are indeed not alone.

